import React, { useState, useEffect } from "react";
import axios from "axios";

function CreateUser() {
    // State to hold the create user data
    const [create, setcreate] = useState([]);

    // Fetch create user data from the API
    useEffect(() => {
      axios.get("http://localhost/COMP333_HW3/index.php/createuser")
        .then((response) => {
          setcreate(response.data);
        })
        .catch((error) => {
          console.error("Error fetching create user data:", error);
        });
    }, []);

    return (
      <div>
        <h1>Sign Up</h1>
        <ul>
          {create.map((create) => (
            <li key={create.id}>
              Username: {create.username}, Password: {create.password}
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default CreateUser;
